        public string kolor;
        public double waga;
        private int wiek;
        private double temperatura;

        public double TemperaturaC
        {
            get { return temperatura; }
            set {
                if (value < 35 || value > 45)
                    temperatura = 39;
                else
                    temperatura = value;
            }
        }
