void insertion_sort_interi(unsigned long v[], int numero_elementi)
{
  for (int i = 1; i < numero_elementi; i++) {
    int elemento_corrente = v[i];

    int j = i - 1;
    while( j>=0 && v[j] > elemento_corrente)
    {
      v[j + 1] = v[j];
      j--;
    }
    v[j + 1] = elemento_corrente;
  }
}

