#include <iostream>
#include <vector>

using namespace std;

pair<int, int> BiggestIncreasingSubs(const vector<int>& arr){
    int l = -1;
    int r = -1;
    int biggest_len = 0;
    int cur_l = 0;
    for (int i = 0; i < arr.size() - 1; ++i){
        if (arr[i] > arr[i+1]){
            if (i - cur_l + 1 > biggest_len){
                l = cur_l;
                r = i;
                biggest_len = i - cur_l + 1;
            }
            cur_l = i + 1;
        }
    }
    if (arr.size() - cur_l > biggest_len){
        l = cur_l;
        r = arr.size() - 1;
    }
    return {l, r};
}

int main() {
    int n;
    cin >> n;
    vector<int> v(n);
    for (int i = 0; i < n; ++i) {
        cin >> v[i];
    }
    auto ans1 = BiggestIncreasingSubs(v);
    reverse(v.begin(), v.end());
    auto ans2 = BiggestIncreasingSubs(v);
    if (ans1.second - ans1.first > ans2.second - ans1.first){
        cout << ans1.first << " " << ans1.second;
    } else {
        cout << v.size() - 1 - ans2.second << " " << v.size() - ans1.first - 1;
    }
    return 0;
}

#include <virtuabotixRTC.h>
#include <LiquidCrystal_I2C.h>
#include <Wire.h>
virtuabotixRTC myRTC(6, 7, 8);
const byte sensorPin = A0, relay = 4;
byte lastSecond, humidity;
bool relayState = 0, lastRelayState = 0;
LiquidCrystal_I2C lcd(0X27, 16, 2);

//Update display every second
byte updateLCD(int val){
  byte h = map(val,520,200,0,100);
  lcd.setCursor(0, 0);
  lcd.print("Temps:");
  lcd.setCursor(7,0);
  char buf[10];
  sprintf(buf,"%02u:%02:%02", myRTC.hours, myRTC.minutes, myRTC.seconds);
  lcd.print(buf);
  lcd.setCursor(0,1);
  lcd.print("Humidity:");
  lcd.setCursor(10,1);
  lcd.print(humidity,DEC);
  Serial.print(myRTC.hours);
  Serial.print(myRTC.minutes);
  Serial.println(myRTC.seconds);
  lastSecond = myRTC.seconds;
  return h;
}

void setup(void){
  Serial.begin(9600);
  pinMode(relay, OUTPUT);
  digitalWrite(relay, relayState);
  myRTC.setDS1302Time(00, 06, 14, 4, 22, 02, 2024);
  lastSecond = myRTC.seconds;
  lcd.init();
  lcd.backlight();
  lcd.setCursor(0, 0);
  lcd.print("Saha");
  delay(200);
  lcd.clear();
}

void loop(void) {
  myRTC.updateTime();

  //Every Second update LCD
  if(myRTC.seconds != lastSecond){
    int sensorValue = analogRead(sensorPin);
    humidity = updateLCD(sensorValue);
  }
  
  if ((myRTC.month == 12 ||myRTC.month == 1||myRTC.month == 2) &&
      (myRTC.dayofweek == 4)&&
      (myRTC.hours >= 12 && myRTC.hours <= 14)){
        if(humidity <= 80){
          relayState = 1;
        }else{
          relayState = 0;
        }
      }
  if ((myRTC.month >= 3 && myRTC.month <=  5)&&
      (myRTC.dayofweek == 1 || myRTC.dayofweek == 4)&&
      (myRTC.hours == 16) && (myRTC.minutes == 0)) {
        if(humidity <= 90){
            relayState = 1;
          }else{
            relayState = 0;
          }
      }
  if ((myRTC.month >= 6 && myRTC.month <= 8)&&
      (myRTC.dayofweek == 1|| myRTC.dayofweek == 3|| myRTC.dayofweek == 6)&&
      (myRTC.hours == 16) && (myRTC.minutes == 0)){
        if(humidity <= 90){
          relayState = 1;
        }else{
          relayState = 0;
        }
      }
  if ((myRTC.month >= 9 && myRTC.month <= 11)&&
      (myRTC.dayofweek == 1 || myRTC.dayofweek == 4)&&
      (myRTC.hours == 16) && (myRTC.minutes == 0)){
        if(humidity <= 90){
          relayState = 1;
        }else{
          relayState = 0;
        }
      }
  if(relayState != lastRelayState){
    digitalWrite(relay, relayState);
  }
  lastRelayState = relayState;
}

