/* Function to get the middle of the linked list*/
/*K will always be in range */

class Solution {
    public:
    Node* deleteK(Node *head,int k){
    
      Node* temp = head;
      Node* prev = NULL;
      
      if(k == 1)
        return prev;
        
      int ctr = 1;
      while(temp!=NULL){
        if(ctr % k == 0){
            if(prev != NULL)
                prev->next = temp->next;
        }
        
        prev = temp;
        temp = temp->next;
        ctr++;
      }
      
      return head;
    }
};

