#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>
#include <string.h>
#define maxans 200000

int cmp(const void *a, const void *b){
    int *c = (int*)a;
    int *d = (int*)b;
    if (*c<*d) return -1;
    else if (*c>*d) return 1;
    return 0;
}

void recursion(int array[], int **ans, int temp[], int used[], int status, int i, int *a, int n){
    if (i==n){
        // printf("Finish\n");
        for (int t=0; t<n; t++){
            ans[*a][t] = temp[t];
        }
        *a+=1;
        return;
    }
    // printf("Current: %d\n", i);
    for (int t=0; t<n; t++){
        // printf("Checking..... %d: %d\n", t, array[t]);
        if (t>0 && !used[t-1] && array[t]==array[t-1]){
            // printf("t-1:%d, t:%d\n", array[t-1], array[t]);
            continue;
        }
        if (i){
            if (used[t]) continue;
            if (n>2 && array[t]==temp[i-1]) continue;   
            if (i!=1 && !(array[t]>temp[i-1])^(status)){
                continue;
            }
        }
        temp[i] = array[t];
        used[t] = 1;
        int new_status = (i==0)?0:(temp[i]>temp[i-1]);
        recursion(array, ans, temp, used, new_status, i+1, a, n);
        used[t] = 0;
    }
    // printf("Return to %d\n", i-1);
    return;
}


int main(){
    int n, a=0; scanf("%d", &n);
    int array[n]; for (int i=0; i<n; i++) scanf("%d", &array[i]);
    qsort(array, n, sizeof(int), cmp);
    int temp[n], **ans, used[n];
    memset(temp, 0, sizeof(temp));
    memset(used, 0, sizeof(used));
    //initialize ans
    ans = (int**)malloc(sizeof(int*)*maxans);
    for (int i=0; i<maxans; i++) ans[i] = (int*)malloc(sizeof(int)*n);

    recursion(array, ans, temp, used, -1, 0, &a, n);
    printf("%d\n", a);
    for (int i=0; i<a; i++){
        for (int j=0; j<n; j++){
            printf("%d%c", ans[i][j], " \n"[j==n-1]);
        }
    }
}

// a_value = "04:22:00"; hh:mm:ss
// b_value = "06:13:10"; hh:mm:ss

function time_calculation(a_value, b_value)
{
  var hour = 0;
  var minute = 0;
  var second = 0;

  var splitTime1 = a_value.toString().split(':');
  var splitTime2 = b_value.toString().split(':');

  hour = parseInt(check_Int(splitTime1[0]))+parseInt(check_Int(splitTime2[0]));
  minute = parseInt(check_Int(splitTime1[1]))+parseInt(check_Int(splitTime2[1]));
  hour = hour + minute/60;
  hour = Math.floor(hour); // Extra Add
  minute = minute%60;
  second = parseInt(check_Int(splitTime1[2]))+parseInt(check_Int(splitTime2[2]));
  minute = minute + second/60;
  second = second%60;
  const zeroPad = (num, places) => String(num).padStart(places, '0');

  return zeroPad(hour, 2)+':'+zeroPad(minute, 2)+':'+zeroPad(second, 2);
}

function check_Int(argument)
{
  if(argument % 1 === 0){
    return argument;
  }else{
    return 0;
  }
}

function float_calculation(a_value, b_value){
  var total = parseFloat(a_value) + parseFloat(b_value);
  return total.toFixed(2);
}

